import React from 'react';
import { Link } from 'react-router-dom';

export default function Tile(props) {
  return (
    <div className="col-2">
      <Link to={props.to}>
        <div className="tile">
          <div>{props.top}</div>
          <div class="tile-icon">
            <i class={props.icon}></i>
          </div>
          <div>{props.bottom}</div>
        </div>
      </Link>
    </div>
  );
}
